import React from "react";
import Form from 'react-bootstrap/Form';
import {Button} from "react-bootstrap";
import Table from 'react-bootstrap/Table'
import "./style.css";


const CreateProfile=(props)=>{
    return(
            
            <Form onSubmit={props.onSubmit}>
                
                    <Form.Group controlId="fname">
                            <Form.Label>First Name: </Form.Label>  
                            <Form.Control name="fname" className="box" onChange={props.onChange} type="text" placeholder="First name" />
                    </Form.Group>
                    <Form.Group controlId="lname">
                        <Form.Label>Last Name: </Form.Label>
                        <Form.Control name="lname" onChange={props.onChange} type="text" placeholder="Last name" /> 
                    </Form.Group>
                    <Form.Group controlId="email">
                        <Form.Label>Email: </Form.Label>
                        <Form.Control name="email" onChange={props.onChange} type="email" placeholder="Enter email" />
                 </Form.Group>
            </Form>
    );
}

export default CreateProfile;
